const Post = ({ post }) => {
  const lineupElements = post.assignments.map((assignment) => {});
  const songElements = post.songs.map((song) => {
    return <div>{song.title}</div>;
  });

  return (
    <div className="post">
      <div className="lineup">Lineup:</div>
      <div className="songs">
        Songs:
        {songElements}
      </div>
    </div>
  );
};

export default Post;
